import React from 'react';
import { motion } from 'framer-motion';

const services = [
  {
    title: 'AI Photo Transformation',
    description: 'Transform your photos with AI-powered editing',
    icon: 'âœ¨',
    features: [
      'High-quality AI transformations',
      'Multiple style options',
      'Fast processing',
      'Download in various formats'
    ],
    price: '$9.99'
  },
  {
    title: 'Character Creation',
    description: 'Turn photos into fantasy characters',
    icon: 'ðŸ‘‘',
    features: [
      'Fantasy character styles',
      'Superhero transformations',
      'Custom outfits',
      'High-resolution output'
    ],
    price: '$14.99'
  },
  {
    title: '3D Printing Service',
    description: 'Get your characters as 3D printed figures',
    icon: 'ðŸŽ¨',
    features: [
      'High-quality 3D models',
      'Multiple sizes available',
      'Custom painting options',
      'Worldwide shipping'
    ],
    price: '$29.99'
  },
  {
    title: 'Custom Backgrounds',
    description: 'Change photo backgrounds to any scene',
    icon: 'ðŸŒ…',
    features: [
      'Realistic integration',
      'Custom scene creation',
      'High-resolution output',
      'Multiple revisions'
    ],
    price: '$12.99'
  }
];

const Services: React.FC = () => {
  return (
    <div className="bg-gradient-to-br from-primary-50 via-white to-primary-50">
      <div className="mx-auto max-w-7xl px-6 lg:px-8 py-24 sm:py-32">
        <motion.div
          className="mx-auto max-w-2xl text-center"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <h2 className="text-3xl font-bold tracking-tight text-gray-900 sm:text-4xl">
            Our Services
          </h2>
          <p className="mt-6 text-lg leading-8 text-gray-600">
            Choose from our range of AI-powered photo transformation services
          </p>
        </motion.div>

        <div className="mx-auto mt-16 grid max-w-lg grid-cols-1 gap-6 sm:mt-20 lg:mx-0 lg:max-w-none lg:grid-cols-2">
          {services.map((service, index) => (
            <motion.div
              key={service.title}
              className="service-card"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <div className="p-6">
                <div className="flex items-center gap-x-4">
                  <span className="service-icon text-4xl">{service.icon}</span>
                  <h3 className="text-xl font-semibold leading-7 text-gray-900">
                    {service.title}
                  </h3>
                </div>
                <p className="mt-4 text-gray-600">{service.description}</p>
                <ul className="service-features mt-6 space-y-3">
                  {service.features.map((feature) => (
                    <li key={feature} className="flex items-center gap-x-3">
                      <span className="text-primary-500">âœ“</span>
                      {feature}
                    </li>
                  ))}
                </ul>
                <div className="mt-8 flex items-center justify-between">
                  <span className="text-2xl font-bold text-gray-900">{service.price}</span>
                  <button className="btn-primary">Get Started</button>
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Services;
